angular.module("templates", []).run(["$templateCache", function($templateCache) {$templateCache.put("hiscores.html","<div class=\"full-height\" ng-controller=\"hiscores as hiscores\">\n  <div class=\"all-cards\">\n    <div ng-repeat=\"card in hiscores.shuffled track by card.id\" class=\"holds-card\">\n      <img class=\"card\" ng-click=\'hiscores.cardClicked(card.id)\' ng-src=\'/static/images/{{ card.flipped ? card.animal : hiscores.back }}\'>\n    </div>\n  </div>\n  <div class=\"white-screen\"></div>\n  <div class=\"facade full-height\">\n    <div class=\"holds-title\">\n      <a href=\'/memory/play\'>Play</a>\n    </div>\n    <div class=\"holds-hiscores\">\n      <div class=\"scrolling\">\n        <h1>Hi Scores</h1>\n        <div class=\"row\">\n          <div class=\"col-3\">\n            <h4>Initials</h4>\n          </div>\n          <div class=\"col-3\">\n            <h4>Turns</h4>\n          </div>\n          <div class=\"col-3\"></div>\n          <div class=\"col-3\">\n            <h4>Seconds of Play</h4>\n          </div>\n        </div>\n        <div ng-repeat=\"score in hiscores.scores\" class=\"row\">\n          <div class=\"col-3\">\n            <p>{{score.initials}}</p>\n          </div>\n          <div class=\"col-3\">\n            <p>{{score.turns}}</p>\n          </div>\n          <div class=\"col-3\"></div>\n          <div class=\"col-3\">\n            <p>{{ score.elapsedTime / 1000 | number: 0 }}</p>\n          </div>          \n        </div>\n      </div>\n    </div>\n    <footer>\n      <a href=\"rawaan-alkhatib.com\">Cards by Rawaan Alkhatib</a>\n    </footer>\n  </div>\n</div>");
$templateCache.put("play.html","<div class=\"full-height\" ng-controller=\"play as play\">\n  <div class=\"all-cards\">\n    <div ng-repeat=\"card in play.shuffled track by card.id\" class=\"holds-card\">\n      <img class=\"card\" ng-click=\'play.cardClicked(card.id)\' ng-src=\'/static/images/{{ card.flipped ? card.animal : play.back }}\'>\n    </div>\n  </div>\n  <div class=\"white-screen\" ng-hide=\"play.startScreen\">\n    <div class=\"start-count\">\n      <h1>{{play.startCount}}</h1>\n    </div>\n  </div>\n  <div class=\"white-screen\" ng-hide=\"play.endScreen\">\n  </div>\n</div>");}]);